import React, { useState } from 'react';
import { format } from 'date-fns';
import { 
  Eye, 
  Calendar, 
  Baby, 
  Heart, 
  Droplets, 
  Moon,
  Apple,
  Activity,
  User,
  FileText,
  Clock
} from 'lucide-react';
import Modal from '../common/Modal';

const ObstetricsSection = ({ carePlans, onRefresh, isPatientView = false }) => {
  const [selectedPlan, setSelectedPlan] = useState(null);
  const [showDetailModal, setShowDetailModal] = useState(false);

  const handleViewDetails = (plan) => {
    setSelectedPlan(plan);
    setShowDetailModal(true);
  };

  const getPriorityColor = (priority) => {
    switch (priority) {
      case 'urgent': return 'priority-urgent';
      case 'high': return 'priority-high';
      case 'medium': return 'priority-medium';
      case 'low': return 'priority-low';
      default: return 'priority-medium';
    }
  };

  const getCareTypeColor = (type) => {
    switch (type) {
      case 'prenatal': return 'badge-info';
      case 'postnatal': return 'badge-success';
      case 'delivery-prep': return 'badge-warning';
      default: return 'badge-info';
    }
  };

  const getSeverityColor = (severity) => {
    switch (severity) {
      case 'none': return 'text-green-600';
      case 'mild': return 'text-yellow-600';
      case 'moderate': return 'text-orange-600';
      case 'severe': return 'text-red-600';
      default: return 'text-gray-600';
    }
  };

  if (carePlans.length === 0) {
    return (
      <div className="empty-state">
        <Baby className="empty-state-icon" />
        <h3 className="empty-state-title">No Obstetrics Care Plans</h3>
        <p className="empty-state-description">
          {isPatientView 
            ? "You don't have any obstetrics care plans at the moment."
            : "No obstetrics care plans have been created yet."
          }
        </p>
      </div>
    );
  }

  return (
    <>
      {/* Card View */}
      <div className="care-plans-grid">
        {carePlans.map((plan) => (
          <div key={plan._id} className="care-plan-card">
            <div className={`priority-indicator ${getPriorityColor(plan.priority)}`}></div>

            <div className="card-header">
              <div>
                <h3 className="card-title">
                  {plan.careType === 'prenatal' && 'Prenatal Care'}
                  {plan.careType === 'postnatal' && 'Postnatal Care'}
                  {plan.careType === 'delivery-prep' && 'Delivery Preparation'}
                </h3>
                <p className="card-subtitle">
                  <User size={14} />
                  {plan.patientName} • Dr. {plan.doctorName}
                </p>
              </div>
              <span className={`badge ${getCareTypeColor(plan.careType)}`}>
                {plan.careType}
              </span>
            </div>

            <div className="card-content">
              {/* Gestational Week */}
              {plan.gestationalWeek && (
                <div className="care-detail">
                  <Calendar size={16} />
                  <span>Week {plan.gestationalWeek} of pregnancy</span>
                </div>
              )}

              {/* Trimester Symptoms */}
              {plan.careDetails?.trimesterSymptoms && (
                <div className="symptoms-summary">
                  {plan.careDetails.trimesterSymptoms.nausea !== 'none' && (
                    <div className="care-detail">
                      <Droplets size={16} />
                      <span className={getSeverityColor(plan.careDetails.trimesterSymptoms.nausea)}>
                        Nausea: {plan.careDetails.trimesterSymptoms.nausea}
                      </span>
                    </div>
                  )}
                  {plan.careDetails.trimesterSymptoms.mood !== 'stable' && (
                    <div className="care-detail">
                      <Heart size={16} />
                      <span>Mood: {plan.careDetails.trimesterSymptoms.mood}</span>
                    </div>
                  )}
                </div>
              )}

              {/* Baby Movement */}
              {plan.careDetails?.babyMovement?.frequency && (
                <div className="care-detail">
                  <Baby size={16} />
                  <span>Baby movement: {plan.careDetails.babyMovement.frequency}</span>
                </div>
              )}

              {/* Sleep & Nutrition */}
              {plan.careDetails?.sleepNutrition && (
                <div className="care-detail">
                  <Moon size={16} />
                  <span>
                    Sleep: {plan.careDetails.sleepNutrition.sleepHours}h 
                    ({plan.careDetails.sleepNutrition.sleepQuality})
                  </span>
                </div>
              )}

              {/* Postnatal Recovery */}
              {plan.careDetails?.postnatalRecovery && (
                <div className="recovery-summary">
                  {plan.careDetails.postnatalRecovery.bleeding !== 'none' && (
                    <div className="care-detail">
                      <Droplets size={16} />
                      <span className={getSeverityColor(plan.careDetails.postnatalRecovery.bleeding)}>
                        Bleeding: {plan.careDetails.postnatalRecovery.bleeding}
                      </span>
                    </div>
                  )}
                  {plan.careDetails.postnatalRecovery.breastfeedingLogs?.length > 0 && (
                    <div className="care-detail">
                      <Baby size={16} />
                      <span>{plan.careDetails.postnatalRecovery.breastfeedingLogs.length} feeding logs</span>
                    </div>
                  )}
                </div>
              )}

              {/* Instructions Preview */}
              <div className="instructions-preview">
                <FileText size={14} />
                <span>{plan.instructions.substring(0, 100)}...</span>
              </div>
            </div>

            <div className="card-meta">
              <span>
                <Calendar size={12} />
                {format(new Date(plan.createdAt), 'MMM dd, yyyy')}
              </span>
              <span className={`badge badge-${plan.status === 'active' ? 'success' : 'info'}`}>
                {plan.status}
              </span>
            </div>

            <div className="card-actions">
              <button
                onClick={() => handleViewDetails(plan)}
                className="btn btn-outline"
              >
                <Eye size={16} />
                View Details
              </button>
            </div>
          </div>
        ))}
      </div>


      {/* Detail Modal */}
      <Modal
        isOpen={showDetailModal}
        onClose={() => setShowDetailModal(false)}
        title="Obstetrics Care Plan Details"
        size="large"
      >
        {selectedPlan && (
          <div className="care-plan-details">
            {/* Basic Information */}
            <div className="detail-section">
              <h3>Basic Information</h3>
              <div className="detail-grid">
                <div className="detail-item">
                  <label>Patient Name:</label>
                  <span>{selectedPlan.patientName}</span>
                </div>
                <div className="detail-item">
                  <label>Doctor:</label>
                  <span>Dr. {selectedPlan.doctorName}</span>
                </div>
                <div className="detail-item">
                  <label>Care Type:</label>
                  <span className={`badge ${getCareTypeColor(selectedPlan.careType)}`}>
                    {selectedPlan.careType}
                  </span>
                </div>
                {selectedPlan.gestationalWeek && (
                  <div className="detail-item">
                    <label>Gestational Week:</label>
                    <span>Week {selectedPlan.gestationalWeek}</span>
                  </div>
                )}
                <div className="detail-item">
                  <label>Priority:</label>
                  <span className={`badge badge-${selectedPlan.priority === 'high' ? 'error' : selectedPlan.priority === 'medium' ? 'warning' : 'success'}`}>
                    {selectedPlan.priority}
                  </span>
                </div>
                <div className="detail-item">
                  <label>Status:</label>
                  <span className={`badge badge-${selectedPlan.status === 'active' ? 'success' : 'info'}`}>
                    {selectedPlan.status}
                  </span>
                </div>
              </div>
            </div>

            {/* Trimester Symptoms */}
            {selectedPlan.careDetails?.trimesterSymptoms && (
              <div className="detail-section">
                <h3>Trimester Symptoms</h3>
                <div className="detail-grid">
                  <div className="detail-item">
                    <label>Nausea:</label>
                    <span className={getSeverityColor(selectedPlan.careDetails.trimesterSymptoms.nausea)}>
                      {selectedPlan.careDetails.trimesterSymptoms.nausea}
                    </span>
                  </div>
                  <div className="detail-item">
                    <label>Cramps:</label>
                    <span className={getSeverityColor(selectedPlan.careDetails.trimesterSymptoms.cramps)}>
                      {selectedPlan.careDetails.trimesterSymptoms.cramps}
                    </span>
                  </div>
                  <div className="detail-item">
                    <label>Mood:</label>
                    <span>{selectedPlan.careDetails.trimesterSymptoms.mood}</span>
                  </div>
                  <div className="detail-item">
                    <label>Fatigue:</label>
                    <span className={getSeverityColor(selectedPlan.careDetails.trimesterSymptoms.fatigue)}>
                      {selectedPlan.careDetails.trimesterSymptoms.fatigue}
                    </span>
                  </div>
                </div>
              </div>
            )}

            {/* Baby Movement */}
            {selectedPlan.careDetails?.babyMovement && (
              <div className="detail-section">
                <h3>Baby Movement Tracking</h3>
                <div className="detail-grid">
                  <div className="detail-item">
                    <label>Frequency:</label>
                    <span>{selectedPlan.careDetails.babyMovement.frequency}</span>
                  </div>
                  {selectedPlan.careDetails.babyMovement.lastMovement && (
                    <div className="detail-item">
                      <label>Last Movement:</label>
                      <span>{format(new Date(selectedPlan.careDetails.babyMovement.lastMovement), 'PPpp')}</span>
                    </div>
                  )}
                  {selectedPlan.careDetails.babyMovement.notes && (
                    <div className="detail-item full-width">
                      <label>Notes:</label>
                      <span>{selectedPlan.careDetails.babyMovement.notes}</span>
                    </div>
                  )}
                </div>
              </div>
            )}

            {/* Sleep & Nutrition */}
            {selectedPlan.careDetails?.sleepNutrition && (
              <div className="detail-section">
                <h3>Sleep & Nutrition</h3>
                <div className="detail-grid">
                  <div className="detail-item">
                    <label>Sleep Hours:</label>
                    <span>{selectedPlan.careDetails.sleepNutrition.sleepHours} hours</span>
                  </div>
                  <div className="detail-item">
                    <label>Sleep Quality:</label>
                    <span>{selectedPlan.careDetails.sleepNutrition.sleepQuality}</span>
                  </div>
                  <div className="detail-item">
                    <label>Water Intake:</label>
                    <span>{selectedPlan.careDetails.sleepNutrition.waterIntake} liters</span>
                  </div>
                  {selectedPlan.careDetails.sleepNutrition.dietNotes && (
                    <div className="detail-item full-width">
                      <label>Diet Notes:</label>
                      <span>{selectedPlan.careDetails.sleepNutrition.dietNotes}</span>
                    </div>
                  )}
                </div>

                {/* Supplements */}
                {selectedPlan.careDetails.sleepNutrition.supplements?.length > 0 && (
                  <div className="supplements-section">
                    <h4>Supplements</h4>
                    <div className="supplements-list">
                      {selectedPlan.careDetails.sleepNutrition.supplements.map((supplement, index) => (
                        <div key={index} className="supplement-item">
                          <div className="supplement-name">{supplement.name}</div>
                          <div className="supplement-details">
                            <span>Dosage: {supplement.dosage}</span>
                            <span>Frequency: {supplement.frequency}</span>
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                )}
              </div>
            )}

            {/* Postnatal Recovery */}
            {selectedPlan.careDetails?.postnatalRecovery && (
              <div className="detail-section">
                <h3>Postnatal Recovery</h3>
                <div className="detail-grid">
                  <div className="detail-item">
                    <label>Bleeding:</label>
                    <span className={getSeverityColor(selectedPlan.careDetails.postnatalRecovery.bleeding)}>
                      {selectedPlan.careDetails.postnatalRecovery.bleeding}
                    </span>
                  </div>
                  <div className="detail-item">
                    <label>Stitches Condition:</label>
                    <span>{selectedPlan.careDetails.postnatalRecovery.stitchesCondition}</span>
                  </div>
                  <div className="detail-item">
                    <label>Pain Level:</label>
                    <span className={getSeverityColor(selectedPlan.careDetails.postnatalRecovery.painLevel > 6 ? 'severe' : selectedPlan.careDetails.postnatalRecovery.painLevel > 3 ? 'moderate' : 'mild')}>
                      {selectedPlan.careDetails.postnatalRecovery.painLevel}/10
                    </span>
                  </div>
                  <div className="detail-item">
                    <label>Emotional State:</label>
                    <span>{selectedPlan.careDetails.postnatalRecovery.emotionalState}</span>
                  </div>
                </div>

                {/* Breastfeeding Logs */}
                {selectedPlan.careDetails.postnatalRecovery.breastfeedingLogs?.length > 0 && (
                  <div className="breastfeeding-section">
                    <h4>Breastfeeding Logs</h4>
                    <div className="breastfeeding-logs">
                      {selectedPlan.careDetails.postnatalRecovery.breastfeedingLogs.map((log, index) => (
                        <div key={index} className="breastfeeding-log">
                          <div className="log-header">
                            <span>{format(new Date(log.date), 'MMM dd, HH:mm')}</span>
                            <span className="badge badge-info">{log.side}</span>
                          </div>
                          <div className="log-details">
                            <span>Duration: {log.duration} minutes</span>
                            {log.notes && <span>Notes: {log.notes}</span>}
                          </div>
                        </div>
                      ))}
                    </div>
                  </div>
                )}
              </div>
            )}

            {/* Vital Signs */}
            {selectedPlan.vitalSigns && (
              <div className="detail-section">
                <h3>Vital Signs</h3>
                <div className="detail-grid">
                  {selectedPlan.vitalSigns.bloodPressure && (
                    <div className="detail-item">
                      <label>Blood Pressure:</label>
                      <span>
                        {selectedPlan.vitalSigns.bloodPressure.systolic}/
                        {selectedPlan.vitalSigns.bloodPressure.diastolic} mmHg
                      </span>
                    </div>
                  )}
                  {selectedPlan.vitalSigns.weight && (
                    <div className="detail-item">
                      <label>Weight:</label>
                      <span>{selectedPlan.vitalSigns.weight} kg</span>
                    </div>
                  )}
                  {selectedPlan.vitalSigns.temperature && (
                    <div className="detail-item">
                      <label>Temperature:</label>
                      <span>{selectedPlan.vitalSigns.temperature}°C</span>
                    </div>
                  )}
                  {selectedPlan.vitalSigns.heartRate && (
                    <div className="detail-item">
                      <label>Heart Rate:</label>
                      <span>{selectedPlan.vitalSigns.heartRate} bpm</span>
                    </div>
                  )}
                </div>
              </div>
            )}

            {/* Instructions */}
            <div className="detail-section">
              <h3>Instructions</h3>
              <div className="instructions-content">
                {selectedPlan.instructions}
              </div>
            </div>

            {/* Timestamps */}
            <div className="detail-section">
              <h3>Timeline</h3>
              <div className="detail-grid">
                <div className="detail-item">
                  <label>Created:</label>
                  <span>{format(new Date(selectedPlan.createdAt), 'PPpp')}</span>
                </div>
                <div className="detail-item">
                  <label>Last Updated:</label>
                  <span>{format(new Date(selectedPlan.updatedAt), 'PPpp')}</span>
                </div>
                {selectedPlan.nextAppointment && (
                  <div className="detail-item">
                    <label>Next Appointment:</label>
                    <span>{format(new Date(selectedPlan.nextAppointment), 'PPpp')}</span>
                  </div>
                )}
              </div>
            </div>
          </div>
        )}
      </Modal>
    </>
  );
};

export default ObstetricsSection;
